66-21 Feeding and Leading Revelation 7:17 by BRETT MEADOR|June 9th,2013 HD


Those who are saved during the Tribulation period will be fed and led by Jesus on the throne. Read God's promise in Revelation 7:17 and study with us the magnitude of His promise for believers today!

Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non-denominational fellowship associating with all who are in the Body of Christ.  
